import rpy2.robjects as robjects
from numpy import random

def callinR(pvals):
    input = tuple(pvals)
    r = robjects.r
    r['source']("conreg.R")
    data = r("conregr(c(" + str(pvals)[1:-1] + "))")
    adj = []
    for n in data[2]:  # data[2] is r vector of adjusted p vals largest - smallest
        adj.append(n)

    return sorted(adj)
